node.text:
Some fun moments from 2017 in Europe. These clips were buried somehow I think because we came straight home to a world title race with @gabrielmedina when we left Portugal that year. We just found them on an old hard drive and edited a new piece that’s up on Youtube now! This was shot on an infrared camera with a monochrome sensor that our friends @reddigitalcinema loaned us for our trip.
-
@parallelsea
